function getTask(user){
    return {
        "id" : `t-${utilService.makeId()}`,
        "title" : "Task",
        "description" : "task",
        "createdAt" : Date.now(),
        "createdBy" : user,
        "style" : {
            "coverMode" : "",
            "bgColor" : ""
        },
        "labelIds" : [],
        "members" : [],
        "dueDate" : null,
        "isDone" : false
    }
}

function getGroup(user){
    return {
        "id" : `g-${utilService.makeId()}`,
        "title" : "Group",
        "description":"group",
        "createdAt":Date.now(),
        "createdBy":user,
        "tasks" : [getTask(user),getTask(user),getTask(user)],
        "style" : {
            "bgImg" : "",
            "bgClr" : ""
        }
    }
}

